Narcotic Noise - Narcotic Experiments 2013


Five albums experimenting with different aspects of dark ambient.



Part I - Drones: &quot;Bleak Desolation&quot;

Part II - Atmospheres: &quot;Ethereal Emanations&quot;

Part III - Oscillations: &quot;Transcendent Transmissions&quot;

Part IV - Transformations: &quot;Perpetual Metamorphosis&quot;

Part V - Rhythms: &quot;Spiraling Down Through Infinite Space&quot;



Total time: 6 hours
